import React from 'react';
import './App.css';
import Banner from './Banner/Banner';
import Sidebar from './Sidebar/Sidebar';
import Body from './Body/Body';


function App() {
  return (
    <div className="App">
      <Banner/>
      <Sidebar/>
      <Body/>
      <div style={{clear:'both'}}>Below</div>
    </div>
  );
}

export default App;
